  Future<Null> _addMessage() async {
    final DocumentReference document = messages.document();
    document.setData(<String, dynamic>{
      'message': 'Hello world!',
      'timeStamp': DateTime.now()
    });
  }
  _readData() async{
    print(TimeOfDay.now().toString());
    final QuerySnapshot querySnapshot = await firestore.collection('messages').getDocuments();
    print(TimeOfDay.now());
    querySnapshot.documents.asMap().forEach((key,value){
      print('${value.documentID}- ${value.reference.path} - ${value.data}');
    });

  }

  _readDocument() async{
    print(TimeOfDay.now().toString());
    final DocumentSnapshot documentSnapshot = await firestore.collection('messages').document('CSE_B').get();
    print(TimeOfDay.now());
    print('${documentSnapshot.data} - ${documentSnapshot.reference.path} - ${documentSnapshot.documentID}');
  }

